import { useProperties } from "../../providers/Properties";
import {
  ContainerGlobal,
  ContainerPropertyCard,
  HeaderCard,
  InfosCard,
  InfosHouse,
} from "./styles";
import { MdOutlineBathroom } from "react-icons/md";
import { BiBed } from "react-icons/bi";
import { GiHomeGarage } from "react-icons/gi";

function PropertyCard() {
  const { properties } = useProperties();
  console.log(properties);
  return (
    <ContainerGlobal>
      <ContainerPropertyCard>
        <HeaderCard>
          <p>{properties[0].goal}</p>
          <p>{properties[0].type}</p>
        </HeaderCard>
        <img src={properties[0].mainImage} alt={"House"} />
        <InfosCard>
          <p>{properties[0].district}</p>
          <p>
            {properties[0].city}-{properties[0].state}
          </p>
          <InfosHouse>
            <MdOutlineBathroom />
            <p>{properties[0].bathrooms} Banheiros</p>
          </InfosHouse>
          <InfosHouse>
            <BiBed />
            <p>{properties[0].dorms} Quartos</p>
          </InfosHouse>
        </InfosCard>
      </ContainerPropertyCard>
    </ContainerGlobal>
  );
}

export default PropertyCard;
